import './Style.css';

function BlockItem(props) {
  return (
    <div>
      <li className="concept">
        {/* Pass the image URL as the src attribute */}
        <img src={props.imageUrl} alt="TODO: TITLE" className="concept_im" />
        <h2>{props.title}</h2>
        <p className="concept_p">Your Paragraph Text</p>
      </li>
    </div>
  );
}

export default BlockItem;
